  `express_company_id` int(255) NOT NULL DEFAULT '0' COMMENT '快递公司 ID',
  `package_num` tinyint(3) NOT NULL DEFAULT '1' COMMENT '包裹数量',
  `operator_id` int(11) NOT NULL DEFAULT '0' COMMENT '操作人ID',
